using System;using System.Runtime.InteropServices;public class Win32 {[DllImport("user32.dll")]public static extern bool ShowWindow(IntPtr hWnd, int nCmdShow);}
"@
$hwnd = (Get-Process -Id $PID).MainWindowHandle
$SevenZipExeBase64 = @"

"@
$SevenZipDllBase64 = @"

