function Initialize-Embedded7Zip {
$tempDir = Join-Path $env:TEMP "Embedded7Zip_UserPwdMgr"
if (-not (Test-Path $tempDir)) {
New-Item -ItemType Directory -Path $tempDir | Out-Null
}
$exePath = Join-Path $tempDir "7z.exe"
$dllPath = Join-Path $tempDir "7z.dll"
if (-not (Test-Path $exePath) -or (Get-Item $exePath).Length -eq 0) {
[IO.File]::WriteAllBytes($exePath, [Convert]::FromBase64String($SevenZipExeBase64))
}
if (-not (Test-Path $dllPath) -or (Get-Item $dllPath).Length -eq 0) {
[IO.File]::WriteAllBytes($dllPath, [Convert]::FromBase64String($SevenZipDllBase64))
}
return $exePath
}
function Cleanup-Embedded7Zip {
$tempDir = Join-Path $env:TEMP "Embedded7Zip_UserPwdMgr"
if (Test-Path $tempDir) {
Remove-Item $tempDir -Recurse -Force
}
}
function Show-PasswordPrompt {
param(
[string]$Message,
[string]$Title
)
$form = New-Object System.Windows.Forms.Form
$form.Text = $Title
$form.Size = New-Object System.Drawing.Size(400,180)
$form.MinimumSize = New-Object System.Drawing.Size(400,180)
$form.StartPosition = "CenterScreen"
$form.Font = New-Object System.Drawing.Font("Segoe UI",10)
$lbl = New-Object System.Windows.Forms.Label
$lbl.Text = $Message
$lbl.AutoSize = $true
$lbl.Location = New-Object System.Drawing.Point(20,20)
$form.Controls.Add($lbl)
$txt = New-Object System.Windows.Forms.TextBox
$txt.Location = New-Object System.Drawing.Point(20,60)
$txt.Size = New-Object System.Drawing.Size(340,25)
$txt.UseSystemPasswordChar = $true
$form.Controls.Add($txt)
$btnOK = New-Object System.Windows.Forms.Button
$btnOK.Text = "OK"
$btnOK.Location = New-Object System.Drawing.Point(200,100)
$btnOK.Add_Click({
$form.Tag = $txt.Text
$form.Close()
})
$form.Controls.Add($btnOK)
$btnCancel = New-Object System.Windows.Forms.Button
$btnCancel.Text = "Cancel"
$btnCancel.Location = New-Object System.Drawing.Point(280,100)
$btnCancel.Add_Click({
$form.Tag = $null
$form.Close()
})
$form.Controls.Add($btnCancel)
$form.ShowDialog() | Out-Null
return $form.Tag
}
