$ArchiveFileName = "Database.7z"
$Global:ArchivePassword = $null
$HiddenDataDir = Join-Path $BasePath ".data"
if (-not (Test-Path $HiddenDataDir)) {
New-Item -ItemType Directory -Path $HiddenDataDir | Out-Null
try {
$item = Get-Item $HiddenDataDir
$item.Attributes = $item.Attributes `
-bor [System.IO.FileAttributes]::Hidden `
-bor [System.IO.FileAttributes]::System
}
catch {}
}
function Get-SessionBufferFile {
$files = Get-ChildItem -Path $HiddenDataDir -Filter "Session*.7z" -ErrorAction SilentlyContinue
if ($files.Count -eq 0) {
return "Session001.7z"
}
$max = $files.Name |
ForEach-Object { ($_ -replace "Session","" -replace "\.7z","") -as [int] } |
Measure-Object -Maximum |
Select-Object -ExpandProperty Maximum
$next = "{0:000}" -f ($max + 1)
return "Session$next.7z"
}
function Get-ExistingSessionBuffer {
$files = Get-ChildItem -Path $HiddenDataDir -Filter "Session*.7z" -ErrorAction SilentlyContinue
if ($files.Count -eq 0) { return $null }
$max = $files.Name |
ForEach-Object { ($_ -replace "Session","" -replace "\.7z","") -as [int] } |
Measure-Object -Maximum |
Select-Object -ExpandProperty Maximum
return "Session{0:000}.7z" -f $max
}
function Merge-SessionBufferIntoArchive {
param(
[string]$SevenZipPath,
[string]$ArchivePassword
)
$buffer = Get-ExistingSessionBuffer
if (-not $buffer) { return }
$bufferPath  = Join-Path $HiddenDataDir $buffer
$archivePath = Join-Path $HiddenDataDir $ArchiveFileName
$testArgs = @("t","-y","-bd","-p$ArchivePassword",$bufferPath)
$procTest = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $testArgs
$procTest.WaitForExit()
if ($procTest.ExitCode -ne 0) {
return
}
$listArgs = @("l","-p$ArchivePassword",$bufferPath)
$procList = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $listArgs
$output   = $procList.StandardOutput.ReadToEnd()
$procList.WaitForExit()
$files = ($output -split "`n") |
Where-Object { $_ -match "Logs[\\/].*\.log" } |
ForEach-Object {
($_ -replace ".*(Logs[\\/].*\.log).*", '$1')
} |
Sort-Object {
if ($_ -match "_(\d{8}-\d{6})\.log$") {
[datetime]::ParseExact($matches[1], "yyyyMMdd-HHmmss", $null)
}
}
foreach ($f in $files) {
$extractArgs = @("x","-p$ArchivePassword",$bufferPath,"-so",$f)
$procExtract = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $extractArgs
$content     = $procExtract.StandardOutput.ReadToEnd()
$procExtract.WaitForExit()
$args7z = @(
"a",
"-p$ArchivePassword",
"-mhe=on",
$archivePath,
"-si`"$f`""
)
$procAdd = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $args7z -RedirectStdIn
$procAdd.StandardInput.WriteLine($content)
$procAdd.StandardInput.Close()
$procAdd.WaitForExit()
}
Remove-Item $bufferPath -Force
}
function Update-SessionCounter {
if ($Global:SessionBuffer) {
$num = ($Global:SessionBuffer -replace "Session","" -replace "\.7z","") -as [int]
$lblSessionCounter.Text = "$($Strings[$Lang]['SessionCounter']) $num"
}
else {
$lblSessionCounter.Text = "$($Strings[$Lang]['SessionCounter']) N/A"
}
}
function Test-StrongPassword {
param([string]$Password)
$minLength = 14
$hasUpper  = $Password -match "[A-Z]"
$hasLower  = $Password -match "[a-z]"
$hasDigit  = $Password -match "\d"
$hasSymbol = $Password -match "[^a-zA-Z0-9]"
if ($Password.Length -lt $minLength) { return $false }
if (-not $hasUpper) { return $false }
if (-not $hasLower) { return $false }
if (-not $hasDigit) { return $false }
if (-not $hasSymbol) { return $false }
return $true
}
function Invoke-7Zip {
param(
[string]$SevenZipPath,
[string[]]$Arguments,
[switch]$RedirectStdIn,
[string]$WorkingDirectory = $HiddenDataDir
)
$proc = New-Object System.Diagnostics.Process
$proc.StartInfo.FileName = $SevenZipPath
$proc.StartInfo.Arguments = $Arguments -join " "
$proc.StartInfo.UseShellExecute = $false
$proc.StartInfo.RedirectStandardOutput = $true
$proc.StartInfo.RedirectStandardError = $true
$proc.StartInfo.CreateNoWindow = $true
$proc.StartInfo.WorkingDirectory = $WorkingDirectory
if ($RedirectStdIn) {
$proc.StartInfo.RedirectStandardInput = $true
}
$null = $proc.Start()
return $proc
}
function Initialize-ArchivePassword {
param([string]$SevenZipPath)
$zipFile = Join-Path $HiddenDataDir $ArchiveFileName
if ((Test-Path $zipFile) -and ((Get-Item $zipFile).Length -eq 0)) {
Remove-Item $zipFile -Force
}
while ($true) {
$pwd = Show-PasswordPrompt -Message $Strings[$Lang]["EnterArchivePassword"] `
-Title   $Strings[$Lang]["ArchivePasswordTitle"]
if ($pwd -eq $null) { exit }
if ([string]::IsNullOrWhiteSpace($pwd)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["InvalidPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
continue
}
if (-not (Test-Path $zipFile)) {
if (-not (Test-StrongPassword $pwd)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["ArchiveWeakPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
continue
}
$initName = "__archive_initialized__"
$argsInit = @(
"a",
"-p$pwd",
"-mhe=on",
$zipFile,
"-si`"$initName`""
)
$procInit = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $argsInit -RedirectStdIn
$procInit.StandardInput.WriteLine("Archive initialized.")
$procInit.StandardInput.Close()
$procInit.WaitForExit()
if ($procInit.ExitCode -ne 0) {
$err = $procInit.StandardError.ReadToEnd()
[System.Windows.Forms.MessageBox]::Show(
"$($Strings[$Lang]["SevenZipError"]): $err",
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return $false
}
$Global:ArchivePassword = $pwd
return $true
}
else {
$testArgs = @("t","-y","-bd","-p$pwd",$zipFile)
$proc = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $testArgs
$proc.WaitForExit()
if ($proc.ExitCode -ne 0) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["WrongPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
continue
}
$Global:ArchivePassword = $pwd
return $true
}
}
}
function Change-ArchivePassword {
param([string]$SevenZipPath)
$zipFile = Join-Path $HiddenDataDir $ArchiveFileName
if (-not (Test-Path $zipFile)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["NoLogArchive"],
$Strings[$Lang]["Info"],
0,
[System.Windows.Forms.MessageBoxIcon]::Information
)
return
}
$currentPwd = Show-PasswordPrompt -Message $Strings[$Lang]["EnterCurrentArchivePwd"] `
-Title   $Strings[$Lang]["ArchivePasswordTitle"]
if ($currentPwd -eq $null -or [string]::IsNullOrWhiteSpace($currentPwd)) {
return
}
$testArgs = @("t","-y","-bd","-p$currentPwd",$zipFile)
$procTest = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $testArgs
$procTest.WaitForExit()
if ($procTest.ExitCode -ne 0) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["WrongPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
$newPwd = Show-PasswordPrompt -Message $Strings[$Lang]["EnterNewArchivePwd"] `
-Title   $Strings[$Lang]["ArchivePasswordTitle"]
if ($newPwd -eq $null -or [string]::IsNullOrWhiteSpace($newPwd)) { return }
$confirmPwd = Show-PasswordPrompt -Message $Strings[$Lang]["ConfirmNewArchivePwd"] `
-Title   $Strings[$Lang]["ArchivePasswordTitle"]
if ($confirmPwd -eq $null -or [string]::IsNullOrWhiteSpace($confirmPwd)) { return }
if ($newPwd -ne $confirmPwd) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["PasswordsDoNotMatch"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
if (-not (Test-StrongPassword $newPwd)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["ArchiveWeakPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
$tempDir = Join-Path $env:TEMP ("ArchiveRebuild_" + [guid]::NewGuid().ToString())
New-Item -ItemType Directory -Path $tempDir | Out-Null
try {
$extractArgs = @("x","-y","-p$currentPwd",$zipFile,"-o`"$tempDir`"")
$procExtract = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $extractArgs
$procExtract.WaitForExit()
if ($procExtract.ExitCode -ne 0) {
throw "Extraction failed."
}
$newZip = $zipFile + ".new"
if (Test-Path $newZip) { Remove-Item $newZip -Force }
$argsAdd = @(
"a",
"-p$newPwd",
"-mhe=on",
$newZip,
"*"
)
$procAdd = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $argsAdd -WorkingDirectory $tempDir
$procAdd.WaitForExit()
if ($procAdd.ExitCode -ne 0) {
throw "Rebuild failed."
}
Remove-Item $zipFile -Force
Rename-Item -Path $newZip -NewName (Split-Path $zipFile -Leaf)
if (Test-Path $SessionBufferPath) {
$tempBuf = Join-Path $env:TEMP ("SessionRebuild_" + [guid]::NewGuid().ToString())
New-Item -ItemType Directory -Path $tempBuf | Out-Null
try {
$extractBufArgs = @("x","-y","-p$currentPwd",$SessionBufferPath,"-o`"$tempBuf`"")
$procExtractBuf = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $extractBufArgs
$procExtractBuf.WaitForExit()
if ($procExtractBuf.ExitCode -ne 0) {
throw "Failed to extract session buffer."
}
$newBuf = $SessionBufferPath + ".new"
if (Test-Path $newBuf) { Remove-Item $newBuf -Force }
$argsAddBuf = @(
"a",
"-p$newPwd",
"-mhe=on",
$newBuf,
"*"
)
$procAddBuf = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $argsAddBuf -WorkingDirectory $tempBuf
$procAddBuf.WaitForExit()
if ($procAddBuf.ExitCode -ne 0) {
throw "Failed to rebuild session buffer."
}
Remove-Item $SessionBufferPath -Force
Rename-Item -Path $newBuf -NewName (Split-Path $SessionBufferPath -Leaf)
}
finally {
if (Test-Path $tempBuf) {
Remove-Item $tempBuf -Recurse -Force
}
}
}
$Global:ArchivePassword = $newPwd
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["ArchivePwdChanged"],
$Strings[$Lang]["Success"],
0,
[System.Windows.Forms.MessageBoxIcon]::Information
)
}
catch {
[System.Windows.Forms.MessageBox]::Show(
"$($Strings[$Lang]["ArchivePwdChangeFailed"]) $($_.Exception.Message)",
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
}
finally {
if (Test-Path $tempDir) {
Remove-Item $tempDir -Recurse -Force
}
}
}
function Get-Embedded7Zip {
