$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return $null
}
$proc = Invoke-7Zip -SevenZipPath $exe -Arguments @("-h")
$proc.WaitForExit()
if ($proc.ExitCode -ne 0) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["SevenZipError"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return $null
}
return $exe
}
$SevenZipPath = Get-Embedded7Zip
if (-not $SevenZipPath) {
return
}
if (-not (Initialize-ArchivePassword -SevenZipPath $SevenZipPath)) {
exit
}
$existingBuffer = Get-ExistingSessionBuffer
if ($existingBuffer) {
$existingNumber = ($existingBuffer -replace "Session","" -replace "\.7z","") -as [int]
Merge-SessionBufferIntoArchive -SevenZipPath $SevenZipPath -ArchivePassword $ArchivePassword
$nextNumber = $existingNumber + 1
$Global:SessionBuffer = "Session{0:000}.7z" -f $nextNumber
}
else {
$Global:SessionBuffer = "Session001.7z"
}
$Global:SessionBufferPath = Join-Path $HiddenDataDir $SessionBuffer
if (-not (Test-Path $SessionBufferPath)) {
$argsInitBuffer = @(
"a",
"-p$ArchivePassword",
"-mhe=on",
$SessionBufferPath,
"-si`"__init__`""
)
$procInitBuffer = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $argsInitBuffer -RedirectStdIn
$procInitBuffer.StandardInput.WriteLine("Buffer initialized.")
$procInitBuffer.StandardInput.Close()
$procInitBuffer.WaitForExit()
}
$principal = New-Object Security.Principal.WindowsPrincipal([Security.Principal.WindowsIdentity]::GetCurrent())
if (-not $principal.IsInRole([Security.Principal.WindowsBuiltInRole]::Administrator)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["AdminRequired"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
function Show-GroupManager {
param(
