)
$allGroups = Get-LocalGroup | Select-Object -ExpandProperty Name
$userGroups = @()
try {
$adsiUser = [ADSI]"WinNT://./$UserName,user"
$userGroups = @($adsiUser.psbase.Invoke("Groups") |
ForEach-Object { $_.GetType().InvokeMember("Name",'GetProperty',$null,$_,$null) })
}
catch {}
$gm = New-Object System.Windows.Forms.Form
$gm.Text = $Strings[$Lang]['ManageGroups'] + " - $UserName"
