$clb = New-Object System.Windows.Forms.CheckedListBox
$clb.Dock = "Top"
$clb.Height = 380
$gm.MinimumSize = New-Object System.Drawing.Size(400, 500)
foreach ($g in $allGroups) {
$index = $clb.Items.Add($g)
if ($userGroups -contains $g) {
$clb.SetItemChecked($index, $true)
}
}
$gm.Controls.Add($clb)
$btnApply = New-Object System.Windows.Forms.Button
$btnApply.Text = $Strings[$Lang]["Apply"]
$btnApply.Size = New-Object System.Drawing.Size(100,30)
$btnApply.Location = New-Object System.Drawing.Point(60,400)
$btnApply.Add_Click({
try {
foreach ($g in $allGroups) {
if ($userGroups -contains $g -and -not ($clb.CheckedItems -contains $g)) {
Remove-LocalGroupMember -Group $g -Member $UserName -ErrorAction SilentlyContinue
}
}
foreach ($g in $clb.CheckedItems) {
if (-not ($userGroups -contains $g)) {
Add-LocalGroupMember -Group $g -Member $UserName -ErrorAction SilentlyContinue
}
}
$newGroups = @()
try {
$adsiUserAfter = [ADSI]"WinNT://./$UserName,user"
$newGroups = @(
$adsiUserAfter.psbase.Invoke("Groups") |
ForEach-Object { $_.GetType().InvokeMember("Name",'GetProperty',$null,$_,$null) }
)
}
catch {
$newGroups = @()
}
$os = (Get-CimInstance Win32_OperatingSystem).Caption
$osVer = (Get-CimInstance Win32_OperatingSystem).Version
$ipObj = Get-NetIPAddress -AddressFamily IPv4 |
Where-Object { $_.PrefixOrigin -in @("Dhcp","Manual") } |
Select-Object -First 1
$ip = if ($ipObj) { $ipObj.IPAddress } else { "N/A" }
$timestamp = (Get-Date -Format "yyyyMMdd-HHmmss")
$internalName = "Logs/$env:COMPUTERNAME/${UserName}_Groups_${timestamp}.log"
$addedGroups = $clb.CheckedItems | Where-Object { $userGroups -notcontains $_ }
$removedGroups = $userGroups | Where-Object { $clb.CheckedItems -notcontains $_ }
$logContent = @"
[$(Get-Date)]
Operator: $env:USERNAME
Computer: $env:COMPUTERNAME
IP: $ip
OS: $os ($osVer)
Modified account: $UserName
Groups: $($newGroups -join ", ")
Added groups:    $($addedGroups -join ", ")
Removed groups:  $($removedGroups -join ", ")
Notes: $notes
----------------------------------------
"@
$bufferArgs = @(
"a",
"-p$ArchivePassword",
"-mhe=on",
$SessionBufferPath,
"-si`"$internalName`""
)
$proc = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $bufferArgs -RedirectStdIn
$utf8Bytes = [System.Text.Encoding]::UTF8.GetBytes($logContent)
$utf8String = [System.Text.Encoding]::UTF8.GetString($utf8Bytes)
$proc.StandardInput.WriteLine($utf8String)
$proc.StandardInput.Close()
$proc.WaitForExit()
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["GroupsUpdated"],
$Strings[$Lang]["Info"],
0,
[System.Windows.Forms.MessageBoxIcon]::Information
)
$gm.Close()
Refresh-UserList
}
catch {
[System.Windows.Forms.MessageBox]::Show(
$_.Exception.Message,
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
}
})
$gm.Controls.Add($btnApply)
$btnClose = New-Object System.Windows.Forms.Button
$btnClose.Text = $Strings[$Lang]["Close"]
$btnClose.Size = New-Object System.Drawing.Size(100,30)
$btnClose.Location = New-Object System.Drawing.Point(200,400)
$btnClose.Add_Click({
$gm.Close()
Refresh-UserList
})
$gm.Controls.Add($btnClose)
$gm.ShowDialog()
}
function Refresh-UserList {
$userList.Items.Clear()
$UserNameMap.Clear()
$LocalUsers = Get-LocalUser | Where-Object {
$_.Enabled -and $_.Name -notin @("Guest","DefaultAccount","WDAGUtilityAccount")
}
foreach ($u in $LocalUsers) {
$groups = @()
try {
$adsiUser = [ADSI]"WinNT://./$($u.Name),user"
$groups = @($adsiUser.psbase.Invoke("Groups") |
ForEach-Object { $_.GetType().InvokeMember("Name",'GetProperty',$null,$_,$null) })
}
catch {}
if (-not $groups -or $groups.Count -eq 0) {
$groupsText = "Local Users"
}
else {
$groupsText = $groups -join ", "
}
$display = "$($u.Name) ($groupsText)"
$userList.Items.Add($display)
$UserNameMap[$display] = $u.Name
}
}
function New-RandomPassword {
param([int]$Length = 14)
$lower   = 'abcdefghijklmnopqrstuvwxyz'
$upper   = 'ABCDEFGHIJKLMNOPQRSTUVWXYZ'
$digits  = '0123456789'
$special = '!$%&/()=?*#@'
$all = ($lower + $upper + $digits + $special).ToCharArray()
$pwd = @()
$pwd += $lower[(Get-Random -Maximum $lower.Length)]
$pwd += $upper[(Get-Random -Maximum $upper.Length)]
$pwd += $digits[(Get-Random -Maximum $digits.Length)]
$pwd += $special[(Get-RRandom -Maximum $special.Length)]
for ($i = $pwd.Count; $i -lt $Length; $i++) {
$pwd += $all[(Get-Random -Maximum $all.Length)]
}
-join ($pwd | Sort-Object {Get-Random})
}
