$internalName = "Logs/$env:COMPUTERNAME/${userName}_Pswrds_${timestamp}.log"
$logContent = @"
[$(Get-Date)]
Operator: $env:USERNAME
Computer: $env:COMPUTERNAME
IP: $ip
OS: $os ($osVer)
Modified account: $userName
Password: $newPassword
Notes: $notes
----------------------------------------
"@
$zipFile = Join-Path $HiddenDataDir $ArchiveFileName
if (-not (Test-Path $zipFile)) {
if (-not (Test-StrongPassword $ArchivePassword)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["ArchiveWeakPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
}
if (Test-Path $zipFile) {
$testArgs = @("t","-y","-bd","-p$ArchivePassword",$zipFile)
$procTest = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $testArgs
$procTest.WaitForExit()
if ($procTest.ExitCode -ne 0) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["WrongArchivePassword"],
$Strings[$Lang]["ArchiveError"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
}
$bufferArgs = @(
"a",
"-p$ArchivePassword",
"-mhe=on",
$SessionBufferPath,
"-si`"$internalName`""
)
$proc = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $bufferArgs -RedirectStdIn
$utf8Bytes = [System.Text.Encoding]::UTF8.GetBytes($logContent)
$utf8String = [System.Text.Encoding]::UTF8.GetString($utf8Bytes)
$proc.StandardInput.WriteLine($utf8String)
$proc.StandardInput.Close()
$proc.WaitForExit()
if ($proc.ExitCode -ne 0) {
$err = $proc.StandardError.ReadToEnd()
[System.Windows.Forms.MessageBox]::Show(
"$($Strings[$Lang]["SevenZipError"]): $err",
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
}
else {
[System.Windows.Forms.MessageBox]::Show(
"$($Strings[$Lang]["PasswordUpdated"]) $userName.",
$Strings[$Lang]["Success"],
0,
[System.Windows.Forms.MessageBoxIcon]::Information
)
}
$txtPassword.Clear()
$txtNotes.Clear()
$userList.ClearSelected()
}
catch {
[System.Windows.Forms.MessageBox]::Show(
"$($Strings[$Lang]["Error"]): $($_.Exception.Message)",
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
}
finally {
$btnApplyPassword.Enabled = $true
$btnViewLogs.Enabled = $true
$btnGenerate.Enabled = $true
if ($btnChangeArchivePwd) { $btnChangeArchivePwd.Enabled = $true }
$form.Cursor = [System.Windows.Forms.Cursors]::Default
}
})
$form.Controls.Add($btnApplyPassword)
$btnViewLogs = New-Object System.Windows.Forms.Button
$btnViewLogs.Text = $Strings[$Lang]["ViewLogs"]
$btnViewLogs.Location = New-Object System.Drawing.Point(260,360)
$btnViewLogs.Size = New-Object System.Drawing.Size(180,30)
$btnViewLogs.Anchor = "Bottom, Left"
$btnViewLogs.Add_Click({
$zipFile = Join-Path $HiddenDataDir $ArchiveFileName
if (-not (Test-Path $zipFile)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["NoLogArchive"],
$Strings[$Lang]["Info"],
0,
[System.Windows.Forms.MessageBoxIcon]::Information
)
return
}
if ([string]::IsNullOrWhiteSpace($ArchivePassword)) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["InvalidPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
$form.Cursor = [System.Windows.Forms.Cursors]::WaitCursor
$btnViewLogs.Enabled = $false
try {
$testArgs = @("t","-y","-bd","-p$ArchivePassword",$zipFile)
$procTest = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $testArgs
$procTest.WaitForExit()
if ($procTest.ExitCode -ne 0) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["WrongPassword"],
$Strings[$Lang]["Error"],
0,
[System.Windows.Forms.MessageBoxIcon]::Error
)
return
}
$listArgs = @("l","-p$ArchivePassword",$zipFile)
$procList = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $listArgs
$output = $procList.StandardOutput.ReadToEnd()
$procList.WaitForExit()
$files = ($output -split "`n") |
Where-Object { $_ -match "Logs[\\/].*\.log" } |
ForEach-Object {
($_ -replace ".*(Logs[\\/].*\.log).*", '$1')
} |
Sort-Object {
if ($_ -match "_(\d{8}-\d{6})\.log$") {
[datetime]::ParseExact($matches[1], "yyyyMMdd-HHmmss", $null)
}
}
if ($files.Count -eq 0) {
[System.Windows.Forms.MessageBox]::Show(
$Strings[$Lang]["NoLogsFound"],
$Strings[$Lang]["Info"],
0,
[System.Windows.Forms.MessageBoxIcon]::Information
)
return
}
$selectForm = New-Object System.Windows.Forms.Form
$selectForm.Text = $Strings[$Lang]["SelectLogFile"]
$selectForm.Size = New-Object System.Drawing.Size(400,400)
$selectForm.MinimumSize = New-Object System.Drawing.Size(400,400)
$selectForm.StartPosition = "CenterScreen"
$listBox = New-Object System.Windows.Forms.ListBox
$listBox.Dock = "Fill"
$files | ForEach-Object { $listBox.Items.Add($_) }
$selectForm.Controls.Add($listBox)
$listBox.Add_DoubleClick({
$selected = $listBox.SelectedItem
if ($selected) {
$extractArgs = @("x","-p$ArchivePassword",$zipFile,"-so",$selected)
$procExtract = Invoke-7Zip -SevenZipPath $SevenZipPath -Arguments $extractArgs
$content = $procExtract.StandardOutput.ReadToEnd()
$procExtract.WaitForExit()
$viewer = New-Object System.Windows.Forms.Form
$viewer.Text = "$($Strings[$Lang]['LogViewer']) - $selected"
$viewer.Size = New-Object System.Drawing.Size(400,400)
$viewer.MinimumSize = New-Object System.Drawing.Size(400,400)
$txt = New-Object System.Windows.Forms.TextBox
$txt.Multiline = $true
$txt.ReadOnly = $true
$txt.ScrollBars = "Both"
$txt.Dock = "Fill"
$txt.Text = $content
$viewer.Controls.Add($txt)
$viewer.ShowDialog()
}
})
$selectForm.ShowDialog()
}
finally {
$btnViewLogs.Enabled = $true
$form.Cursor = [System.Windows.Forms.Cursors]::Default
}
})
$form.Controls.Add($btnViewLogs)
$btnExportLog = New-Object System.Windows.Forms.Button
$btnExportLog.Text = $Strings[$Lang]["ExportLog"]
$btnExportLog.Location = New-Object System.Drawing.Point(470,400)
$btnExportLog.Size = New-Object System.Drawing.Size(130,30)
$btnExportLog.Anchor = "Bottom, Right"
$btnExportLog.Add_Click({
